import React, { Component } from 'react';

class Inventory extends Component{
	render() {
		return (
			<tr>
				<td>{this.inventory.recipe.name}</td>
				<td>{this.props.inventory.quantity}</td>
			</tr>
		)
	}
}

export default Inventory;
